    <style>
        .checkbox-pc {
            display: none;
        }

        .toggle-pc {
            position: absolute;
            left: 20px;
            top: 130px;
            width: 30px;
            height: 20px;
            display: block;
            border-radius: 20px;
            z-index: 3;
        }

        .toggle-pc:after {
            content: '';
            position: absolute;
            top: 2px;
            left: 2px;
            width: 16px;
            height: 16px;
            background: white;
            border-radius: 50%;
            transition: 0.2s;
        }

        .checkbox-pc:checked + .toggle-pc:after {
            left: 12px;
        }

        .checkbox-tab {
            display: none;
        }

        .toggle-tab {
            position: absolute;
            left: 20px;
            top: 250px;
            width: 150px;
            height: 100px;
            display: block;
            border-radius: 100px;
            z-index: 3;
        }

        .toggle-tab:after {
            content: '';
            position: absolute;
            top: 10px;
            left: 10px;
            width: 80px;
            height: 80px;
            background: white;
            border-radius: 50%;
            transition: 0.2s;
        }

        .checkbox-tab:checked + .toggle-tab:after {
            left: 60px;
        }

        button {
            position: absolute;
            left: 20px;
            top: 20px;
            background-color: white;
            border-width: 1px;
            z-index: 2;
        }

        svg {
            position: absolute;
            left: 0px;
            top: 0px;
            z-index: 1;
        }
    </style>

    <script>
        const HIGHLIGHT_COLOR = d3.rgb(255.0, 195.0, 0.0);  // Highlight marker color
        const MINIMUM_SCALE = 0.05;                         // Minimum zoom scale
        const MAXIMUM_SCALE = 80.0;                         // Maximum zoom scale

        // Hide scroll bars
        d3.select('body').style('overflow', 'hidden')

        // Get window size
        let windowWidth = window.innerWidth || document.documentElement.clientWidth || document.body.clientWidth;
        let windowHeight = window.innerHeight || document.documentElement.clientHeight || document.body.clientHeight;
        if (windowWidth <= 0 || windowHeight <= 0) {
            alert('Failed to get window size.');
            throw new Error('Failed to get window size.');  // Abort process
        }

        // Set SVG display size
        let svg = d3.select('body')
            .select('svg')
            .attr('width', windowWidth)
            .attr('height', windowHeight);

        // Resize SVG display size
        window.addEventListener('resize', function(){
            windowWidth = window.innerWidth || document.documentElement.clientWidth || document.body.clientWidth;
            windowHeight = window.innerHeight || document.documentElement.clientHeight || document.body.clientHeight;
            
            svg.attr('width', windowWidth)
                .attr('height', windowHeight);
        });

        // Layer to zoom
        let zoomLayer = svg.select('g')

        // Layers for controlling z-order
        zoomLayer.append('g').attr('id', 'back-layer');
        zoomLayer.append('g').attr('id', 'front-layer').attr('opacity', 0.15);  // Always translucent

        // Set zoom behavior
        let zoomed = function () {
            zoomLayer.attr('transform', d3.event.transform);
        }
        let zoom = d3.zoom()
                        .scaleExtent([MINIMUM_SCALE, MAXIMUM_SCALE])
                        .on('zoom', zoomed);

        // Bind zoom event
        svg.call(zoom);

        // Parse JSON data
        var jsonData = {}
        try {
            jsonData = JSON.parse(d3.select('#json-data').html());
        } catch(e) {
            alert('Failed to parse JSON data.');
            throw new Error('Failed to parse JSON data.');  // Abort process
        }

        // Draw rectangle highlights
        for (rectangle of jsonData.rectangles) {

            if (rectangle.visible) {

                // Draw highlights on the front layer
                let frontLayerRectangle = svg.select('#front-layer')
                    .append('rect')
                    .attr('data-guids-to-link', rectangle.guidsToLink.join(','))   // Combine multiple GUIDs to link with commas
                    .attr('x', rectangle.x)
                    .attr('y', rectangle.y)
                    .attr('width', rectangle.width)
                    .attr('height', rectangle.height)
                    .attr('fill', 'white')
                    .attr('fill-opacity', 0.0)
                    .attr('stroke-width', 10.0)
                    .attr('stroke', HIGHLIGHT_COLOR)
                    .attr('stroke-opacity', 1.0)        // Since the "front-layer" is set to semi-transparent, no transparency is set here
                    .attr('data-tippy-content', rectangle.tooltip)
                    .on('mouseover', function(){

                        // Draw highlights on the back layer
                        svg.select('#back-layer')
                            .append('rect')
                            .attr('id', 'temporary_highlight')
                            .attr('x', this.attributes.x.nodeValue)
                            .attr('y', this.attributes.y.nodeValue)
                            .attr('width', this.attributes.width.nodeValue)
                            .attr('height', this.attributes.height.nodeValue)
                            .attr('fill', 'white')
                            .attr('fill-opacity', 0.0)
                            .attr('stroke-width', 10.0)
                            .attr('stroke', HIGHLIGHT_COLOR)
                            .attr('stroke-opacity', 0.75);

                        // Collect link destinations with the same GUID
                        let destGuidsToLink = this.dataset.guidsToLink.split(',');    // Split multiple GUIDs to link by comma

                        // Start point of the link
                        let linkStartPointX = this.x.baseVal.value + (this.width.baseVal.value * 0.5);
                        let linkStartPointY = this.y.baseVal.value + (this.height.baseVal.value * 0.5);

                        // Draw highlights of the link destination
                        drawHighlightsOfTheLink(linkStartPointX, linkStartPointY, destGuidsToLink);
                    })
                    .on('mouseout', function(){
                        // Remove temporary highlights
                        removeTemporaryHighlights();
                    });
                
                // Create a tooltip using the Tippy library
                if (rectangle.tooltip) {
                    tippy(frontLayerRectangle.node(), {
                        allowHTML: true,
                        interactive: true,
                        interactiveBorder: 2,
                        arrow: true,
                        placement: 'top',
                        maxWidth: 'none',
                        theme: 'light-border',
                    });
                }
            }
        }

        // Draw line highlights
        for (line of jsonData.lines) {

            if (line.visible) {

                // Create a line path
                let linePath = d3.path();
                linePath.moveTo(line.points[0].x, line.points[0].y);
                if (line.isCurve) {
                    // In the case of curve line
                    if (line.points.length == 2) {
                        linePath.lineTo(line.points[1].x, line.points[1].y);
                    } else if (line.points.length == 4) {
                        linePath.bezierCurveTo(line.points[1].x, line.points[1].y, line.points[2].x, line.points[2].y, line.points[3].x, line.points[3].y);
                    } else {
                        // If the number of points on the line is other than 2 or 4, it is incorrect.
                        continue;
                    }
                } else {
                    // In the case of straight line
                    for (let i = 1; i < line.points.length; i++) {
                        linePath.lineTo(line.points[i].x, line.points[i].y);
                    }
                }

                // Draw highlights on the front layer
                let frontLayerLine = svg.select('#front-layer')
                    .append('path')
                    .attr('data-guids-to-link', line.guidsToLink.join(','))   // Combine multiple GUIDs to link with commas
                    .attr('d', linePath)
                    .attr('fill', 'none')
                    .attr("stroke-width", 15.0)
                    .attr('stroke-linecap', 'butt')
                    .attr('stroke', HIGHLIGHT_COLOR)
                    .attr('stroke-opacity', 1.0)        // Since the "front-layer" is set to semi-transparent, no transparency is set here
                    .attr('data-tippy-content', line.tooltip)
                    .on('mouseover', function(){

                        // Draw highlights on the back layer
                        svg.select('#back-layer')
                            .append('path')
                            .attr('id', 'temporary_highlight')
                            .attr('d', this.attributes.d.nodeValue)
                            .attr('fill', 'none')
                            .attr("stroke-width", 15.0)
                            .attr('stroke-linecap', 'butt')
                            .attr('stroke', HIGHLIGHT_COLOR)
                            .attr('stroke-opacity', 0.75);

                        // Collect link destinations with the same GUID
                        let destGuidsToLink = this.dataset.guidsToLink.split(',');    // Split multiple GUIDs to link by comma

                        // Start point of the link
                        let linkNode = frontLayerLine.node();
                        let midpointOfLink = linkNode.getPointAtLength(linkNode.getTotalLength() / 2);
                        let linkStartPointX = midpointOfLink.x;
                        let linkStartPointY = midpointOfLink.y;

                        // Draw highlights of the link destination
                        drawHighlightsOfTheLink(linkStartPointX, linkStartPointY, destGuidsToLink);
                    })
                    .on('mouseout', function(){
                        // Remove temporary highlights
                        removeTemporaryHighlights();
                    });
                
                // Create a tooltip using the Tippy library
                if (line.tooltip) {
                    tippy(frontLayerLine.node(), {
                        allowHTML: true,
                        interactive: true,
                        interactiveBorder: 2,
                        arrow: true,
                        followCursor: 'initial',
                        maxWidth: 'none',
                        theme: 'light-border',
                    });
                }
            }
        }

        var ua = navigator.userAgent;
        if (ua.indexOf('iPhone') > 0
            || ua.indexOf('iPod') > 0
            || ua.indexOf('Android') > 0
            || ua.indexOf('Windows Phone') > 0
            || ua.indexOf('iPad') > 0) {
            // Mobile or Tablet

            // Create Zoom Fit button
            d3.select('body')
                .append('button')
                .text('Fit')
                .attr('id', 'fit-button')
                .style('width', '150px')
                .style('height', '150px')
                .style('font-size', '75px')
                .style('margin-top', '0px')
                .style('padding', '0px')
                .on('mouseover', function(){
                    d3.select(this).style('background-color', '#eeeeee');
                })
                .on('mouseout', function(){
                    d3.select(this).style('background-color', '#ffffff');
                })
                .on('click', function(){
                    let diagramsWidth = jsonData.size.width;
                    let diagramsHeight = jsonData.size.height;
                    let scale = Math.min(windowWidth / diagramsWidth, windowHeight / diagramsHeight);
                    scale = Math.max(scale, MINIMUM_SCALE);     // Do not allow less than minimum
                    scale = Math.min(scale, MAXIMUM_SCALE);     // Do not allow greater than maximum

                    // Move center of diagrams to center of window and scale
                    let centerXofDiagrams = diagramsWidth * scale * 0.5;
                    let centerYofDiagrams = diagramsHeight * scale * 0.5;
                    let centerXofBrowser = windowWidth * 0.5;
                    let centerYofBrowser = windowHeight * 0.5;
                    svg.transition().duration(750).ease(d3.easeSinOut).call(zoom.transform, d3.zoomIdentity
                        .translate(centerXofBrowser - centerXofDiagrams, centerYofBrowser - centerYofDiagrams)
                        .scale(scale));
                });

            // Create Show/Hide toggle button
            d3.select('body')
                .append('input')
                .attr('type', 'checkbox')
                .attr('id', 'switch-tab')
                .attr('class', 'checkbox-tab')
                .attr('checked', true)
                .on('change', function(){
                    if (this.checked) {
                        // Show highlights
                        svg.select('#front-layer')
                            .attr('visibility', 'visible');

                        // Change toggle background color
                        d3.select('.toggle-tab')
                            .style('background', HIGHLIGHT_COLOR);
                    } else {
                        // Hide highlights
                        svg.select('#front-layer')
                            .attr('visibility', 'hidden');

                        // Change toggle background color
                        d3.select('.toggle-tab')
                            .style('background', 'silver');
                    }
                });
            
            // Create Show/Hide toggle button label
            d3.select('body')
                .append('label')
                .attr('for', 'switch-tab')
                .attr('class', 'toggle-tab')
                .style('background', HIGHLIGHT_COLOR);

        }else {
            // PC

            // Create Zoom In button
            d3.select('body')
                .append('button')
                .text('＋')
                .style('width', '30px')
                .style('height', '30px')
                .style('font-size', '15px')
                .style('margin-top', '0px')
                .style('padding', '0px')
                .on('mouseover', function(){
                    d3.select(this).style('background-color', '#eeeeee');
                })
                .on('mouseout', function(){
                    d3.select(this).style('background-color', '#ffffff');
                })
                .on('click', function(){
                    zoom.scaleBy(svg.transition().duration(250), 1.5);
                });

            // Create Zoom Out button
            d3.select('body')
                .append('button')
                .text('－')
                .style('width', '30px')
                .style('height', '30px')
                .style('font-size', '15px')
                .style('margin-top', '32px')
                .style('padding', '0px')
                .on('mouseover', function(){
                    d3.select(this).style('background-color', '#eeeeee');
                })
                .on('mouseout', function(){
                    d3.select(this).style('background-color', '#ffffff');
                })
                .on('click', function(){
                    zoom.scaleBy(svg.transition().duration(250), 0.75);
                });

            // Create Zoom Fit button
            d3.select('body')
                .append('button')
                .text('Fit')
                .attr('id', 'fit-button')
                .style('width', '30px')
                .style('height', '30px')
                .style('font-size', '15px')
                .style('margin-top', '64px')
                .style('padding', '0px')
                .on('mouseover', function(){
                    d3.select(this).style('background-color', '#eeeeee');
                })
                .on('mouseout', function(){
                    d3.select(this).style('background-color', '#ffffff');
                })
                .on('click', function(){
                    let diagramsWidth = jsonData.size.width;
                    let diagramsHeight = jsonData.size.height;
                    let scale = Math.min(windowWidth / diagramsWidth, windowHeight / diagramsHeight);
                    scale = Math.max(scale, MINIMUM_SCALE);     // Do not allow less than minimum
                    scale = Math.min(scale, MAXIMUM_SCALE);     // Do not allow greater than maximum

                    // Move center of diagrams to center of window and scale
                    let centerXofDiagrams = diagramsWidth * scale * 0.5;
                    let centerYofDiagrams = diagramsHeight * scale * 0.5;
                    let centerXofBrowser = windowWidth * 0.5;
                    let centerYofBrowser = windowHeight * 0.5;
                    svg.transition().duration(750).ease(d3.easeSinOut).call(zoom.transform, d3.zoomIdentity
                        .translate(centerXofBrowser - centerXofDiagrams, centerYofBrowser - centerYofDiagrams)
                        .scale(scale));
                });

            // Description of the toggle button
            let desc = 'Show/Hide Highlights and Hyperlinks';

            // Temporarily create a description and get the text length
            let tmpDesc = svg.append('text')
                .attr('font-family', 'sans-serif')
                .attr('font-size', '16px')
                .text(desc);
            let descWidth = tmpDesc.node().getComputedTextLength();
            tmpDesc.remove();

            // Create a path using the text length
            svg.append('path')
                .attr('id', 'path')
                .attr('d', 'M 0 16 L ' + descWidth + ' 16')
                .style("stroke-width", 0)
                .attr('transform', 'translate(55,130)');

            // Create a rectangle behind the description
            let btnDescRect = svg.append('rect')
                .attr('width', 0)
                .attr('height', 22)
                .attr('fill', '#ffffff')
                .attr("stroke-width", 0)
                .attr('transform', 'translate(55,130)');

            // Create a description and set the path
            let btnDesc = svg.append('text')
                .append('textPath')
                .attr('xlink:href', '#path')
                .attr('startOffset', -descWidth)
                .attr('font-family', 'sans-serif')
                .attr('font-size', '16px')
                .attr('fill', '#555555')
                .attr('stroke-width', 0)
                .text(desc);

            // Create Show/Hide toggle button
            d3.select('body')
                .append('input')
                .attr('type', 'checkbox')
                .attr('id', 'switch-pc')
                .attr('class', 'checkbox-pc')
                .attr('checked', true)
                .on('change', function(){
                    if (this.checked) {
                        // Show highlights
                        svg.select('#front-layer')
                            .attr('visibility', 'visible');

                        // Change toggle background color
                        d3.select('.toggle-pc')
                            .style('background', HIGHLIGHT_COLOR);
                    } else {
                        // Hide highlights
                        svg.select('#front-layer')
                            .attr('visibility', 'hidden');

                        // Change toggle background color
                        d3.select('.toggle-pc')
                            .style('background', 'silver');
                    }
                });
            
            // Create Show/Hide toggle button label
            d3.select('body')
                .append('label')
                .attr('for', 'switch-pc')
                .attr('class', 'toggle-pc')
                .style('background', HIGHLIGHT_COLOR)
                .on('mouseover', function(){
                    // Show the description and the rectangle behind it
                    btnDesc.transition()
                        .duration(300)
                        .ease(d3.easeExpOut)
                        .attr('startOffset', 0);
                    
                    btnDescRect.transition()
                        .duration(300)
                        .ease(d3.easeExpOut)
                        .attr('width', descWidth);
                })
                .on('mouseout', function(){
                    // Hide the description and the rectangle behind it
                    btnDesc.transition()
                        .duration(300)
                        .ease(d3.easeExpOut)
                        .attr('startOffset', -descWidth);

                    btnDescRect.transition()
                        .duration(300)
                        .ease(d3.easeExpOut)
                        .attr('width', 0);
                });
        }

        // Click the Fit button
        d3.select('#fit-button').node().click();

        // FUNCTION: Fucus on a rectangle with the specified GUID
        function focusOn(guid) {
            // Extract rectangles with the same GUID
            let extractedRectangles = jsonData.rectangles.filter(function(item, index){
                    if (guid === item.guid) return true;
                });

            // Check the size of the extracted rectangles
            if (extractedRectangles.length === 0) {
                alert('Hyperlink destination cannot be found.');
                return;
            }

            // The first extracted rectangle is the destination rectangle
            let destRectangle = extractedRectangles[0];

            let scale = Math.min(windowWidth / destRectangle.width, windowHeight / destRectangle.height);
            scale = Math.max(scale, MINIMUM_SCALE);     // Do not allow less than minimum
            scale = Math.min(scale, MAXIMUM_SCALE);     // Do not allow greater than maximum

            // Move center of destination rectangle to center of window and scale
            let centerXofDestRectangle = (destRectangle.x + (destRectangle.width * 0.5)) * scale;
            let centerYofDestRectangle = (destRectangle.y + (destRectangle.height * 0.5)) * scale;
            let centerXofBrowser = windowWidth * 0.5;
            let centerYofBrowser = windowHeight * 0.5;
            svg.transition().duration(1500).ease(d3.easeSinOut).call(zoom.transform, d3.zoomIdentity
                .translate(centerXofBrowser - centerXofDestRectangle, centerYofBrowser - centerYofDestRectangle)
                .scale(scale));
        }

        // FUNCTION: Draw highlights of the link destination
        function drawHighlightsOfTheLink(linkStartPointX, linkStartPointY, destGuidsToLink) {

            // Extract rectangles of the link destination
            let destRectangles = jsonData.rectangles.filter(function(item, index){
                for (srcRectangleGuidToLink of item.guidsToLink) {
                    for (destGuidToLink of destGuidsToLink) {
                        if (srcRectangleGuidToLink && destGuidToLink && srcRectangleGuidToLink === destGuidToLink) return true;
                    }
                }
            });

            // Draw rectangle highlights
            for(destRectangle of destRectangles){                                
                
                // Draw highlights on the back layer
                svg.select('#back-layer')
                    .append('rect')
                    .attr('id', 'temporary_highlight')
                    .attr('x', destRectangle.x)
                    .attr('y', destRectangle.y)
                    .attr('width', destRectangle.width)
                    .attr('height', destRectangle.height)
                    .attr('fill', 'white')
                    .attr('fill-opacity', 0.0)
                    .attr('stroke-width', 10.0)
                    .attr('stroke', HIGHLIGHT_COLOR)
                    .attr('stroke-opacity', 0.75);

                // End point of link to draw
                let linkEndPointX = destRectangle.x + (destRectangle.width * 0.5);
                let linkEndPointY = destRectangle.y + (destRectangle.height * 0.5);
                
                // Draw a link if the start and end points are not close
                if (Math.abs(linkStartPointX - linkEndPointX) > 1
                    || Math.abs(linkStartPointY - linkEndPointY) > 1) {

                    // Draw highlights on the back layer
                    svg.select('#back-layer')
                        .append('line')
                        .attr('id', 'temporary_highlight')
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkStartPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkStartPointY)
                        .attr('stroke-width', 20.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_COLOR)
                        .attr('stroke-opacity', 0.2)
                        .transition()
                        .duration(150)
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkEndPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkEndPointY)
                        .attr('stroke-width', 40.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_COLOR)
                        .attr('stroke-opacity', 0.2);
                }
            }

            // Extract lines of the link destination
            let destLines = jsonData.lines.filter(function(item, index){
                for (srcLinkGuidToLink of item.guidsToLink) {
                    for (destGuidToLink of destGuidsToLink) {
                        if (srcLinkGuidToLink && destGuidToLink && srcLinkGuidToLink === destGuidToLink) return true;
                    }
                }
            });

            // Draw line highlights
            for(destLine of destLines){

                // Create a line path
                let linePath = d3.path();
                linePath.moveTo(destLine.points[0].x, destLine.points[0].y);
                if (destLine.isCurve) {
                    // In the case of curve line
                    if (destLine.points.length == 2) {
                        linePath.lineTo(destLine.points[1].x, destLine.points[1].y);
                    } else if (destLine.points.length == 4) {
                        linePath.bezierCurveTo(destLine.points[1].x, destLine.points[1].y, destLine.points[2].x, destLine.points[2].y, destLine.points[3].x, destLine.points[3].y);
                    } else {
                        // If the number of points on the line is other than 2 or 4, it is incorrect.
                        continue;
                    }
                } else {
                    // In the case of straight line
                    for (let i = 1; i < destLine.points.length; i++) {
                        linePath.lineTo(destLine.points[i].x, destLine.points[i].y);
                    }
                }

                // Draw highlights on the back layer
                let backLayerLink = svg.select('#back-layer')
                    .append('path')
                    .attr('id', 'temporary_highlight')
                    .attr('d', linePath)
                    .attr('fill', 'none')
                    .attr("stroke-width", 15.0)
                    .attr('stroke-linecap', 'butt')
                    .attr('stroke', HIGHLIGHT_COLOR)
                    .attr('stroke-opacity', 0.75);

                // End point of link to draw
                let linkNode2 = backLayerLink.node();
                let midpointOfLink = linkNode2.getPointAtLength(linkNode2.getTotalLength() / 2);
                let linkEndPointX = midpointOfLink.x;
                let linkEndPointY = midpointOfLink.y;
                
                // Draw a link if the start and end points are not close
                if (Math.abs(linkStartPointX - linkEndPointX) > 1
                    || Math.abs(linkStartPointY - linkEndPointY) > 1) {

                    // Draw highlights on the back layer
                    svg.select('#back-layer')
                        .append('line')
                        .attr('id', 'temporary_highlight')
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkStartPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkStartPointY)
                        .attr('stroke-width', 20.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_COLOR)
                        .attr('stroke-opacity', 0.2)
                        .transition()
                        .duration(150)
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkEndPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkEndPointY)
                        .attr('stroke-width', 40.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_COLOR)
                        .attr('stroke-opacity', 0.2);
                }
            }
        }

        // FUNCTION: Remove temporary highlights
        function removeTemporaryHighlights() {
            // Fade out and remove the temporarily highlights
            d3.selectAll('#temporary_highlight')
                .transition()
                .duration(300)
                .attr('stroke-opacity', 0.0)
                .remove();
        }
    </script>
</body>
</html>
